import './App.css';
import { Routes, Route } from "react-router-dom";
// import Logo from './Logo';
import { useState } from 'react'
// import Buscar from './Buscar';
// import Sesion from './Sesion';
// import Products from './Products';
import PaginaPricipal from './PaginaPrincipal/PaginaPrincipal';
import PaginaArticuloId from './PaginaArticuloId';


function App() {
  const [search, setSearch] = useState('')
  const [user, setUser] = useState('')
  return (
    <Routes>
      <Route path="/" element={<PaginaPricipal setUser={setUser} user={user}/>} />
      <Route path="article/:id" element={<PaginaArticuloId />} />
    </Routes>
  );
}

export default App;
